def get_prn(sv,prn_len):
    if(sv<1):
        print("NO SUCH SPACECRAFT")
    prn=prn_matrix[sv-1]

    return stretch_array(prn,prn_len)

def stretch_array(array,new_len):
    new_array=[]
    old_len=len(array)
    for i in range(new_len):
        old_idx=int(old_len*(i/new_len))
        new_array.append(array[old_idx])
    
    return new_array

    